import React from 'react';
import Header from './components/Header';
import Search from './components/Search';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

function App() {
  return (
    <Router>
      <div className="App">
        <Header />
        <Switch>
          <Route path="/search">
            {/* 이 곳에 검색 결과를 보여주는 컴포넌트를 추가하세요 */}
          </Route>
          <Route path="/">
            {/* 기본 홈 페이지 컴포넌트를 여기에 추가하세요 */}
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
